    int main (void)
    {
        volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
        
        //initializing all the graphics positions
        int large_cloud_1x_position = 0;
        int large_cloud_2x_position = 0;
        int large_cloud_3x_position = 0;
        int small_cloud_1x_position = 0;
        int small_cloud_2x_position = 0;
        int dino_position = 0;

        bool cactus_present = false; 
        int cactus_displayed = 0; 
        int cactus_timer = 1;
        make_cacti();
        make_dino();
        //pixel_buffer_start = *pixel_ctrl_ptr;
        // set front pixel buffer to start of FPGA On-chip memory
        *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the back buffer

        // now, swap the front/back buffers, to set the front buffer location 
        wait_for_vsync();

        // initialize a pointer to the pixel buffer, used by drawing functions 
        pixel_buffer_start = *pixel_ctrl_ptr;
        clear_screen(); // pixel_buffer_start points to the pixel buffer

        // set back pixel buffer to start of SDRAM memory 
        *(pixel_ctrl_ptr + 1) = 0xC0000000;
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
        clear_screen(); // pixel_buffer_start points to the pixel buffer


        while (!game_over)
        {

            curr_key = *key_pressed;
            //polling to make my dino jump
            if (curr_key == 0 && prev_key == 2 && !jumping) //check if key 1 was pressed -> check if 2?
            {
                prev_dino_pos = dino_position;
                dino_position = 0; //set the dino_position to stand still
                jumping = true;
                jump_start = true;
            }

            while (cactus_timer == 1) //start page
            {
                pace = 10000;
                curr_key = *key_pressed;
                if (!(curr_key == 0 && prev_key == 1))
                {
                    short int color = 0;
                    int pixel = 0;
                    
                    for (int coord = 0; coord < 320*240; coord++)
                    {
                        color = (start_page[start_page_index][pixel + 1] << 8) | (start_page[start_page_index][pixel]) ; //concatenating the two pixels
                        if (color != 0)
                            plot_pixel((coord%320),(coord/320), color);
                        pixel = pixel + 2;
                    }

                    wait_for_vsync(); // swap front and back buffers on VGA vertical sync
                    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
                    clear_screen();
                    if (start_page_index < 2)
                    {
                        start_page_index++;
                    } else if (start_page_index == 2)
                    {
                        start_page_index = 0;
                    }
                    prev_key = curr_key;
                } 
                else 
                {
                    wait_for_vsync(); // swap front and back buffers on VGA vertical sync
                    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
                    cactus_timer++;
                    clear_screen();
                    pace = 0;
                }
            }

            //draws background
            game_graphic (&large_cloud_1x_position, &large_cloud_2x_position, &large_cloud_3x_position, 
                            &small_cloud_1x_position, &small_cloud_2x_position); //setting up the game

            //draws dino
            draw_dino_position(dino_position);

            //draws cacti
            if (cactus_present)
            {
                draw_cacti(cactus_displayed);
            }

            if (end_game) //draw final screen
            {
                short int color = 0;
                int pixel = 0;
                
                for (int coord = 0; coord < 320*240; coord++)
                {
                    color = (gamedone_graphic[pixel + 1] << 8) | (gamedone_graphic[pixel]) ; //concatenating the two pixels
                    if (color != 0)
                        plot_pixel((coord%320),(coord/320), color);
                    pixel = pixel + 2;
                }
                game_over = true;
            }

            //double buffer the game set_up
            wait_for_vsync(); // swap front and back buffers on VGA vertical sync
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer

            //deletes all the graphics
            delete_game_graphic(&large_cloud_1x_position, &large_cloud_2x_position, &large_cloud_3x_position, 
                            &small_cloud_1x_position, &small_cloud_2x_position); //delete what was previously on the displayed buffer
            delete_dino_position(dino_position);
            delete_cacti_prev(cactus_displayed);

            //check obstacles
            check_obstacle(dino_position);

            if (end_game)
            {
                prev_dino_pos = dino_position;
                dino_position = 3;
            }
            //updates all the graphics

            update_graphic_locations(&large_cloud_1x_position, &large_cloud_2x_position, &large_cloud_3x_position, 
                                        &small_cloud_1x_position, &small_cloud_2x_position);
            
            update_dino_location(&dino_position);

            //update obstacles
            if (!cactus_present) // to draw the first cactus
            {
                if (cactus_timer % 20 == 0)
                {
                    cactus_displayed++;
                    cactus_present = true;
                }
            }
            if (cactus_present && cactus_timer % 120 == 0 && cactus_displayed < MAX_CACTI) //determining after the first is drawn
            {
                cactus_displayed++;
            }

            update_cacti_positions(cactus_displayed);

            //increment the number of times the code has ran through the while loop
            cactus_timer++;
            prev_key = curr_key;

            if (cactus_timer % 1000 == 0 && pace > 10000)
            {
                pace = pace / 2;
            }
        }
    }


    void make_dino() //copies all three dino positions into the array
    {
        for(int dino_num = 0; dino_num < number_of_dinoPos; dino_num++)
        {
            dino[dino_num].row = DINO_X;
            dino[dino_num].col = DINO_Y;
            for (int col = 0; col < 1800; col++)
            {
                dino[dino_num].graphic[col] =  dino_positions[dino_num][col];
            }
            dino[dino_num].size = 30;
        }
    }



    void update_dino_location(int* dino_position)
    {
        //updating dinosaur running
        if (*dino_position == 3)
            *dino_position = 3;
        else if (*dino_position == 1)
            *dino_position = 2;
        else if (*dino_position == 2)
            *dino_position = 1;
        else if (*dino_position == 0 && jumping == true) //ensures this only happens when a button is pressed and not initially
        {
            if (dino[*dino_position].col == DINO_Y)
            {
                if (jump_start)
                {
                    dino[*dino_position].col = dino[*dino_position].col - 1; //up
                    prev_dino_col = -1;
                    up = true;
                    jump_start = false;
                }
                else 
                {
                    jumping = false;
                    prev_dino_col = 1;
                    down = false;
                }
            } else if (dino[*dino_position].col > 115 && up) //between DINO_Y & DINO_Y - 30
            {
                dino[*dino_position].col = dino[*dino_position].col - 1; //up
                prev_dino_col = -1;
                if (dino[*dino_position].col == 115)
				{
                    up = false;
                    down = true;
				}
            } else if (down) //less than DINO_Y - 30
            {
                dino[*dino_position].col = dino[*dino_position].col + 1; //down
                prev_dino_col = 1;
            }
        } else 
        {
            *dino_position = 1;
        }

    }

    //animates the dinosaur running
    void draw_dino_position(int dino_position)
    {
        draw_graphic(dino[dino_position].row, dino[dino_position].col, dino[dino_position].graphic, dino[dino_position].size);
    }

    void delete_dino_position(int dino_position)
    {
        if(dino_position == 0 && jumping == true)
        {
            if (jump_start)
            {
                if (prev_dino_pos == 1)
                    delete_graphic(dino[2].row, dino[2].col, dino[2].graphic, dino[2].size);
                else if (prev_dino_pos == 2)
                    delete_graphic(dino[1].row, dino[1].col, dino[1].graphic, dino[1].size);
            }
            else
            {
                delete_graphic(dino[0].row, dino[0].col - prev_dino_col, dino[0].graphic, dino[0].size);
            }
        }
        else if (jumping == false && dino[0].col != DINO_Y) 
        {
            delete_graphic(dino[0].row, dino[0].col - prev_dino_col, dino[0].graphic, dino[0].size);
        }
        else if (dino_position == 0 && jumping == false)
        {
            int dino_reindex = 1;
            delete_graphic(dino[dino_reindex].row, dino[dino_reindex].col, dino[dino_reindex].graphic, dino[dino_reindex].size);
        }
        else
        {
            delete_graphic(dino[dino_position - 1].row, dino[dino_position - 1].col, dino[dino_position - 1].graphic, dino[dino_position - 1].size);
        } 
    }

    //checks for collision
    void check_obstacle(int dino_position)
    {
        if(cactii[0].row < DINO_X + 15 && cactii[0].row > 0 && dino[dino_position].col > DINO_Y - 15) //reaches the dino block
        {
            end_game = true;
        }    
    }

    void make_cacti() //initializes the first three cacti
    {

        for (int cactus_num = 0; cactus_num < MAX_CACTI; cactus_num++)
        {
            int random_cacti = rand() % NUM_CACTI;
            {
                cactii[cactus_num].row = RESOLUTION_X - 1;
                cactii[cactus_num].col = CACTI_Y;
                for (int col = 0; col < 1800; col++)
                {
                    cactii[cactus_num].graphic[col] = cactuses [random_cacti][col];
                };
                cactii[cactus_num].size = 30;
            }
        }
    }

    void draw_cacti(int cacti_displayed) //this is correct
    {
        for (int cactus_num = 0; cactus_num < cacti_displayed; cactus_num++) //shows the current cacti on the screen 
        {
            draw_graphic(cactii[cactus_num].row, cactii[cactus_num].col, cactii[cactus_num].graphic, cactii[cactus_num].size);
        }
    }

    void update_cacti_positions(int cacti_displayed) //to update: we want to store rearrange the positions of the cactus
    {
        int random_cacti = rand() % NUM_CACTI;
        //cactus temp_storage[MAX_CACTI];
        for (int cactus_num = 0; cactus_num < cacti_displayed; cactus_num++)
        {
            if (cactii[cactus_num].row > - 29) {
                cactii[cactus_num].row = cactii[cactus_num].row - 1;
            }
            else 
            {
                //copies the other cactus into the temp array
                for (int cactus = 0; cactus < MAX_CACTI - 1; cactus++)
                {
                    cactii[cactus] = cactii[cactus + 1]; //the first one gets deleted
                }

                //Updates cactus 3 with the new cacti 
                cactii[MAX_CACTI - 1].row = RESOLUTION_X - 1;
                for (int col = 0; col < 1800; col++)
                {
                    // cactii[MAX_CACTI - 1].graphic[col] = 0x00;
                    cactii[MAX_CACTI - 1].graphic[col] = cactuses[random_cacti][col];
                }
                cactus_num--;
            }
        }
    }

    void delete_cacti_prev(int cacti_displayed)
    {
        for (int cactus_num = 0; cactus_num < cacti_displayed; cactus_num++)
        {
            delete_graphic(cactii[cactus_num].row + 1, cactii[cactus_num].col, cactii[cactus_num].graphic, cactii[cactus_num].size);
        }
    }


